import React, { StrictMode } from "react";
import ReactDOM from "react-dom/client";

function App() {
  return (
    <div>
      <Header />
      <Main />
      <Skills />
    </div>
  );
}

function Header() {
  return (
    <headerr
      imgName="F:\React\challenge1\public\me.jpg"
      name="Vishal Kumar Singh"
    />
  );
}

function headerr(props) {
  return (
    <div>
      <img src={props.imgName} alt={props.name}></img>
      <h1>{props.name}</h1>
    </div>
  );
}

function Main() {
  return (
    <div>
      <p>
        I am a passionate B.Tech student with a strong interest in web
        development and software engineering. Proficient in JavaScript, React,
        and modern web technologies, I enjoy building interactive and
        user-friendly applications. I have experience working with APIs,
        optimizing performance, and creating intuitive user interfaces. Always
        eager to learn and explore new technologies, I strive to develop
        efficient and innovative solutions. My goal is to continuously grow as a
        developer and contribute to meaningful projects that make a difference.
      </p>
    </div>
  );
}

function Skills() {
  // const bgColor = {{}}
  return (
    <div style={{ backgroundColor: "#111111" }}>
      <Skill
        skill="HTML + CSS"
        emoji="✌️"
      />
    </div>
  );
}

function Skill(props) {
  return (
    <div>
      <span>{props.skill}</span>
      <span>{props.emoji}</span>
    </div>
  );
}

const root = ReactDOM.createRoot(document.getElementById("root"));

root.render(
  <StrictMode>
    <App />
  </StrictMode>
);
